import React from 'react';

// import Filter from '../Filter/Filter';

function SearchForm() {
  return (
    <div className='auth__input auth__input_type_email'>
      <form
        formName='login'
        title='Рады видеть!'
        buttonText='Войти'
        linkText='Ещё не зарегистрированы?'
        linkTo='/signup'
        link='Регистрация'>
        <div className='auth__inputs'>
          <input
            className='auth__input auth__input_type_email'
            id='email-input'
            type='email'
            name='email'
            autoComplete='off'
            required
          />

          <button
            className={`auth__button`}
            type='submit'></button>
        </div>
      </form>
    </div>
  );
}

export default SearchForm;
